import React from "react"
import { View, Text } from "react-native"
export const LoginScreen = () => {
    return (
        <View style={{
            flex : 1,
            alignItems : 'center',
            justifyContent : 'center',
            backgroundColor : 'white'
        }}>
            <Text>Login</Text>
        </View>
    )
}
